import React from 'react';
import classes from "./Skills.module.css";
import PageHeader from '../PageHeader/PageHeader';
import codethinking from './../../Components/img/codethinking.jpg'
const ListTitleStyle = {fontweight: 900, color:'#9B1FE8', marginbottom:'4px'}
const DS_skills=
     <ul>
         <li style={ListTitleStyle}>Data Science</li>
         <li>Python Programming knowledge-Scikitlearn-Data Manipulation and Analysis-Data Visualization-Deep Learning-OpenCV</li>
     </ul>
const programming=
     <ul>
         <li style={ListTitleStyle}>Programming Language</li>
         <li>C-C++-Python-JavaScript</li>
     </ul>
const frontend=
    <ul>
        <li style={ListTitleStyle}>Frontend</li>
        <li>HTML5-CSS-JavaScript-React.js</li>
    </ul>
const other=
    <ul>
        <li style={ListTitleStyle}>Other Skills</li>
        <li>Tkinter(GUI)-Git-GitHub</li>
    </ul>    
const Totalskills = [DS_skills,programming,frontend,other] 

const Skills = () =>{
    return(
        <>
        <div className={classes.Skills}>
         <PageHeader title={"What About The Skills?"}/>
         <p>
            
         </p>
         <div className={classes.Container}>
         <img src={codethinking} alt="code thinking"/>
          { Totalskills.map(skills => {
              return(
                  <div className={classes.List}>
                  {skills}
                  </div>
              );
          })}
         </div> 
        </div>
        </>
    );
}

export default Skills;
